import React from "react";
import RButton from "./RButton";
import styled from "styled-components";
import { Button } from "antd";

const SRButton = styled.button`
  width: 200px;
  height: 25px;
  margin: 10px;

  outline: none;
  border: ${(props) => (props.isBorder ? "1px solid #999" : "none")};
  border-radius: 5px;

  transition: 0.5s;

  &:hover {
    background-color: skyblue;
    color: #fff;
    cursor: pointer;
  }
`;

const CustomButton = styled(Button)`
  //antd Button의 css 들어있음
`;

class App extends React.Component {
  render() {
    return (
      <div>
        <RButton />

        <SRButton>BUTTON</SRButton>
        <SRButton isBorder={true}>TRUE BUTTON</SRButton>
        <SRButton isBorder={false}>FALSE BUTTON</SRButton>

        <Button size="small" type="primary">
          antd Button
        </Button>

        <CustomButton size="small" type="primary"></CustomButton>
      </div>
    );
  }
}

export default App;
